    false,nt"url": null,nt"notes": "The Lower San Joaquin Levee District (LSJLD)
    requires that six miles of levee situated along the San Joaquin River on San Luis
    National Wildlife Refuge (SLNWR) be maintained for flood control. The refuge, via
    terms of a January 10, 1969 agreement, has accepted responsibility for the maintenance
    of this levee and in return, the LSJLD has granted public access to the levee. Over
    the years, the levee has deteriorated as a result of the burrowing activities of
    California ground squirrels. Certain sections of the levee are heavily infested
    with holes, decreasing the levee's ability to retain abnormal flood flows. The agreement
    mandates that the refuge implement and maintain a rodent control program that would
    help alleviate levee impacts as specified in the Reclamation Board's Operation and
    Maintenance Manual For Levees, Irrigation and Drainage Structures, Channels and
    Miscellaneous Facilities (See Attachment 1).",nt"license_title": "License
